import React from "react";

const Hourly = () => {
  return (
    <div className="page">
      <h1>Hourly Data</h1>
      <p>
        Here you can read the hourly weather report for the following days. Keep
        in mind that it is not actually every hour, but every 3 - 5 hours
      </p>
      <div className="row">
        <div className="col-md-2">Icon</div>
        <div className="col-md-2">Description</div>
        <div className="col-md-2">Time</div>
        <div className="col-md-2">Temperature</div>
        <div className="col-md-2">Humidity</div>
        <div className="col-md-2">Wind Speed</div>
      </div>
      <div id="tableResult"></div>
    </div>
  );
};

export default Hourly;
